		///   By setting the <c>exclusive</c> kwarg to <c>True</c>, an exclusive cumprod is
		///   performed instead:
		///   
		///    <code>
		///   tf.cumprod([a, b, c], exclusive=True)  # =&amp;gt; [1, a, a * b]
		///    </code>
		///   
