		/// <summary>
		///   Decode a 16-bit PCM WAV file to a float tensor.
		/// </summary>
		/// <param name="contents">
		///   The WAV-encoded audio, usually from a file.
		/// </param>
		/// <param name="operName">
		///   If specified, the created operation in the graph will be this one, otherwise it will be named 'DecodeWav'.
		/// </param>
