		///   
		///   Simple indexing into a matrix:
		///   
		///    <code>
		///   indices = [[0, 0], [1, 1]]
		///   params = [['a', 'b'], ['c', 'd']]
		///   output = ['a', 'd']
		///    </code>
		///   
		///   Slice indexing into a matrix:
		///   
		///    <code>
		///   indices = [[1], [0]]
		///   params = [['a', 'b'], ['c', 'd']]
		///   output = [['c', 'd'], ['a', 'b']]
		///    </code>
		///   
		///   Indexing into a 3-tensor:
		///   
		///    <code>
		///   indices = [[1]]
		///   params = [[['a0', 'b0'], ['c0', 'd0']],
		///   [['a1', 'b1'], ['c1', 'd1']]]
		///   output = [[['a1', 'b1'], ['c1', 'd1']]]
		///   
		///   
		///   indices = [[0, 1], [1, 0]]
		///   params = [[['a0', 'b0'], ['c0', 'd0']],
		///   [['a1', 'b1'], ['c1', 'd1']]]
		///   output = [['c0', 'd0'], ['a1', 'b1']]
		///   
		///   
		///   indices = [[0, 0, 1], [1, 0, 1]]
		///   params = [[['a0', 'b0'], ['c0', 'd0']],
		///   [['a1', 'b1'], ['c1', 'd1']]]
		///   output = ['b0', 'b1']
		///    </code>
		///   
		///   Batched indexing into a matrix:
		///   
		///    <code>
		///   indices = [[[0, 0]], [[0, 1]]]
		///   params = [['a', 'b'], ['c', 'd']]
		///   output = [['a'], ['b']]
		///    </code>
		///   
		///   Batched slice indexing into a matrix:
		///   
		///    <code>
		///   indices = [[[1]], [[0]]]
		///   params = [['a', 'b'], ['c', 'd']]
		///   output = [[['c', 'd']], [['a', 'b']]]
		///    </code>
		///   
		///   Batched indexing into a 3-tensor:
		///   
		///    <code>
		///   indices = [[[1]], [[0]]]
		///   params = [[['a0', 'b0'], ['c0', 'd0']],
		///   [['a1', 'b1'], ['c1', 'd1']]]
		///   output = [[[['a1', 'b1'], ['c1', 'd1']]],
		///   [[['a0', 'b0'], ['c0', 'd0']]]]
		///   
		///   indices = [[[0, 1], [1, 0]], [[0, 0], [1, 1]]]
		///   params = [[['a0', 'b0'], ['c0', 'd0']],
		///   [['a1', 'b1'], ['c1', 'd1']]]
		///   output = [[['c0', 'd0'], ['a1', 'b1']],
		///   [['a0', 'b0'], ['c1', 'd1']]]
		///   
		///   
		///   indices = [[[0, 0, 1], [1, 0, 1]], [[0, 1, 1], [1, 1, 0]]]
		///   params = [[['a0', 'b0'], ['c0', 'd0']],
		///   [['a1', 'b1'], ['c1', 'd1']]]
		///   output = [['b0', 'b1'], ['d0', 'c1']]
		///    </code>
		///   
		///   See also <c>tf.gather</c> and <c>tf.batch_gather</c>.
		/// </remarks>
		public TFOutput GatherNd (TFOutput parameters, TFOutput indices, string operName = null)
		{
			var desc = new TFOperationDesc (this, "GatherNd", MakeName ("GatherNd", operName));
			desc.AddInput (parameters);
			desc.AddInput (indices);
			foreach ( TFOperation control in CurrentDependencies )
				desc.AddControlInput (control);
			
			var op = desc.FinishOperation ();
			int _idx = 0;
			var output = new TFOutput (op, _idx++);
			return output;
		}

