			desc.AddInput (tensor);
			desc.AddInput (shape);
			foreach ( TFOperation control in CurrentDependencies )
				desc.AddControlInput (control);
			
			var op = desc.FinishOperation ();
			int _idx = 0;
			var output = new TFOutput (op, _idx++);
			return output;
		}

