		///   Whether to use Adaptive SDCA for the inner loop.
		/// </param>
		/// <param name="loss_type">
		///   Type of the primal loss. Currently SdcaSolver supports logistic,
		///   squared and hinge losses.
		/// </param>
		/// <param name="l1">
