		///   Applies softmax to a batched N-D <c>SparseTensor</c>.
		/// </summary>
		/// <param name="sp_indices">
		///   2-D.  <c>NNZ x R</c> matrix with the indices of non-empty values in a
		///   SparseTensor, in canonical ordering.
		/// </param>
